import './Footer.css';
import {FOOTER_company, FOOTER_customerCare, FOOTER_account, FOOTER_socials} from '../../const.js';

function Footer() {
    return (
        <div className="Footer">









        <div className="section1">
            <h4>Customer Care</h4>
            {FOOTER_customerCare.map((customer) => {
                return (
                    <div>
                        <a href={customer.link}>
                        {customer.name}
                        </a>
                    </div>
                );
            })}
        </div>

        <div className="section2">
            <h4>About AVRG</h4>
            {FOOTER_company.map((company) => {
                return (
                    <div>
                        <a href={company.link}>
                        {company.name}
                        </a>
                    </div>
                );
            })}
        </div>



        <div className="section3">
            <h4>My Account</h4>
            {FOOTER_account.map((account) => {
                return (
                    <div>
                        <a href={account.link}>
                        {account.name}
                        </a>
                    </div>
                );
            })}
        </div>


        <div className='section4'>
            <h4>Subscribe to our newsletter</h4>
		    <input type="text" name="" value="Email address" />
            <button type="button" name="button">SUBSCRIBE</button>
            <div className='social_links'>
                {FOOTER_socials.map((socials) => {
                return (
                    <div>
                        <a href={socials.link}>
                        <img className='social_icons' src={socials.src} alt='' />
                        </a>
                    </div>

                );
                })}
            </div>
        </div>


        </div>
    );
}

export default Footer
